import React from 'react';
import logo from './logo.svg';

function App() {
  return (
    <div className="App">
      Login page
      <br />
      <input type="text" placeholder="Enter user name here" id="email" class="tb" /><br/>
      <input type="password" placeholder="Enter Password here" id="pwd1" class="tb" /><br/>
    </div>
  );
}

export default App;
